declare abstract class BaseAPI {
    private client;
    endpoint: string;
    /**
     * Creates an instance of BaseAPI.
     * @param client - The client to use for making requests.
     */
    constructor(client: Client);
    /**
     * Makes a GET request.
     * @param endpoint - The API endpoint.
     * @param id - The id of the object to get.
     * @param item - The name of the item to get.
     * @returns The response data.
     */
    get({ endpoint, id, item }?: {
        endpoint?: string;
        id?: number;
        item?: string;
    }): Promise<object>;
    /**
     * Makes a POST request.
     * @param endpoint - The API endpoint.
     * @param id - The id of the object to get.
     * @param item - The name of the item to get.
     * @param data - The data to send.
     * @returns The response data.
     */
    post({ endpoint, id, item, data }?: {
        endpoint?: string;
        id?: number;
        item?: string;
        data?: object;
    }): Promise<object>;
    /**
     * Makes a PUT request.
     * @param endpoint - The API endpoint.
     * @param data - The data to send.
     * @returns The response data.
     */
    put({ endpoint, id, item, data }?: {
        endpoint?: string;
        id?: number;
        item?: string;
        data?: object;
    }): Promise<object>;
    /**
     * Makes a PATCH request.
     * @param endpoint - The API endpoint.
     * @param data - The data to send.
     * @returns The response data.
     */
    patch({ endpoint, id, item, data }?: {
        endpoint?: string;
        id?: number;
        item?: string;
        data?: object;
    }): Promise<object>;
}

declare abstract class BaseModel {
    static schema: z.Schema;
    static validate(data: unknown | unknown[]): Promise<any | any[]>;
}

